import React from 'react';
import { Link } from 'react-router-dom';
import AppBarPokemon from './AppBar';

const Main = () => {
    return (
        <div>
            <AppBarPokemon>
                <Link to="/">Home</Link>
                <Link to="/pokemons">Pokedex</Link>
            </AppBarPokemon>
        </div>
    );
};

export default Main;
